PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "migrations" ("migration" varchar null, "batch" integer null);
CREATE TABLE "status" ("id" integer null primary key autoincrement, "type" varchar null, "created_at" datetime null, "updated_at" datetime null);
CREATE TABLE "courses" ("id" integer null primary key autoincrement, "system" integer null, "course_code" varchar null, "course_name" varchar null, "class_code" varchar null, "max_people" integer null, "selected_people" integer null, "teacher" varchar null, "time" varchar null, "year" integer null, "class_room" varchar null, "camps" integer null, "select_type" integer null, "credit" integer null, "class_type" integer null, "semester" integer null, "created_at" datetime null, "updated_at" datetime null);
CREATE TABLE "departments" ("id" integer null primary key autoincrement, "code" varchar null, "name" varchar null, "created_at" datetime null, "updated_at" datetime null);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX status_type_unique on "status" ("type");
CREATE UNIQUE INDEX courses_class_code_unique on "courses" ("class_code");
CREATE INDEX departments_name_index on "departments" ("name");
CREATE UNIQUE INDEX departments_code_unique on "departments" ("code");
COMMIT;
